import React from "react"
import { Text,View ,Button} from "react-native"
export default function Home() {
        return(
            <View style={{ 
                flex: 1,
                alignItems: 'center',
                justifyContent: 'center'
                }}>
                <Text>Hello </Text>
                <Button title="About" onPress={()=>{
                    this.props.navigation.navigate('About')
                }}/>
            </View>
        )
    }
